Storyline

For a group of friends on a bachelor party it was supposed to be the ideal holiday. However; they soon learn that their idyllic holiday island is a test center for a flesh eating virus. Now however; the friends must fight not only the infection, but employees content on using them, as food - and the virus is hungry.


